import React, { useState } from 'react';
import './content.css';
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
import InputRange from 'react-input-range';
import "react-input-range/lib/css/index.css";

function Formbox() {
  const [rangevalue, setRangevalue] = useState(1);
  const [tosleepvalue, setTosleepvalue] = useState(0);
  const [fromsleepvalue, setFromsleepvalue] = useState(0);


  return (
    <div className="box">
      <h1>Form</h1>

      <form>
        <select>
          <option value="Maanantai" defaultValue>Maanantai</option>
          <option value="Tiistai">Tiistai</option>
          <option value="Keskiviikko">Keskiviikko</option>
          <option value="Torstai">Torstai</option>
          <option value="Perjantai">Perjantai</option>
          <option value="Lauantai">Lauantai</option>
          <option value="Sunnuntai">Sunnuntai</option>
        </select>
        <br></br>
        <label>Kävin nukkumaan klo:</label>
        <DatePicker
          showTimeSelect
          showTimeSelectOnly
          timeFormat="HH:mm"
          timeIntervals={15}
          value={tosleepvalue}
          onChange={e => setTosleepvalue(tosleepvalue(e))}
        />
        <label>Heräsin klo:</label>
        <DatePicker
          showTimeSelect
          showTimeSelectOnly
          timeFormat="HH:mm"
          timeIntervals={15}
        />
        <br></br>
        <label>Unen laatu:</label>


        <InputRange
          maxValue={5}
          minValue={1}
          value={rangevalue}
          onChange={e => setRangevalue(e)}
        />

        <label>Sanallinen arvio:</label><br></br>
        <textarea></textarea>

        <button type="submit">Tallenna</button>

      </form>

    </div>
  );
}

export default Formbox;
